import React from "react";
import TodoItemTitle from "./TodoItemTitle/CompletedTitleRenderer";

const TodoItemContainer = ({ id, title, completed, completeTaskClickHandler, removeTaskClickHandler }) => {
   return (
      <div>
         <TodoItemTitle title={title} />
         {completed === false && <button onClick={() => completeTaskClickHandler(id)}>done</button>}
         {completed === false && <button>change</button>}
         <button onClick={() => removeTaskClickHandler(id)}>remove</button>
      </div>
   );
};

export default TodoItemContainer;
